import React from 'react';

export default function AdminDashboard({data}){
  return (
    <div>
      <h2>Administrator Dashboard</h2>
      <p>Welcome, this dashboard is for administrators.</p>
      <div>
        <h3>Info</h3>
        <pre>{JSON.stringify(data || {}, null, 2)}</pre>
      </div>
    </div>
  )
}
